import Link from 'next/link'

const linkStyle = {
  marginRight: 15
}

export default function Header() {
  return (
    <div>
      <Link href="/">
        <a style={linkStyle}>Home</a>
      </Link>
      <Link href="/experience">
        <a style={linkStyle}>About</a>
      </Link>
      <Link href="/projects">
        <a style={linkStyle}>About</a>
      </Link>
      <Link href="/resume">
        <a style={linkStyle}>About</a>
      </Link>
      <Link href="/about">
        <a >About</a>
      </Link>
      <style jsx global>{`
        h1,
        a {
          padding: 0 10px;
          text-decoration: none;
          font-size: 16px;
          color: #666;
        }
      `}</style>
    </div>
  )
}
